begin;

use my_db;
drop table if exists wc_players;

create table wc_players (
    id int4 NOT NULL AUTO_INCREMENT,
    nationality varchar(12) NOT NULL,
    fifa_ranking int4 NOT NULL,
    national_team_kit_sponsor varchar(14),
    position varchar(2) NOT NULL,
    national_team_jersey_number int4,
    player_dob date NOT NULL,
    club varchar(24) NOT NULL,
    player_name varchar(26) NOT NULL,
    appearances varchar(3) NOT NULL,
    goals_scored varchar(3),
    assists_provided varchar(3),
    dribbles_per_90 varchar(5),
    interceptions_per_90 varchar(5),
    tackles_per_90 varchar(5),
    total_duels_won_per_90 varchar(5),
    save_percentage varchar(6),
    clean_sheets varchar(4) NOT NULL,
    brand_sponsorbrand_used varchar(12),
    PRIMARY KEY (id)
);




commit;
